// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadCourbiData(char *Buffer)
{
    memcpy(Buffer, &CourbiL0[1], CourbiL0[0] << 2);
    Buffer += (CourbiL0[0] << 2);

    memcpy(Buffer, &CourbiL1[1], CourbiL1[0] << 2);
    Buffer += (CourbiL1[0] << 2);

    memcpy(Buffer, &CourbiB[1], CourbiB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char CourbiName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillCourbiData(void)
{
    remove(CourbiName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteCourbiData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(CourbiName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, CourbiName)) return "";
    #endif

    if (!(han = fopen(CourbiName, "wb"))) return "";
    if (AutoClean) atexit(KillCourbiData);

    num = fwrite(&CourbiL0[1], 4, CourbiL0[0], han);
    if (num != CourbiL0[0]) {fclose(han); return "";}

    num = fwrite(&CourbiL1[1], 4, CourbiL1[0], han);
    if (num != CourbiL1[0]) {fclose(han); return "";}

    num = fwrite(&CourbiB[1], 1, CourbiB[0], han);
    if (num != CourbiB[0]) {fclose(han); return "";}

    fclose(han);
    return CourbiName;
}

